<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>SND Labs 2026 새해 인사장</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@300;400;700;900&display=swap');
        
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: 'Noto Sans KR', sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            padding: 20px;
        }
        
        .card-container {
            max-width: 1200px;
            width: 100%;
            background: white;
            border-radius: 20px;
            box-shadow: 0 20px 60px rgba(0, 0, 0, 0.3);
            overflow: hidden;
            animation: slideIn 0.8s ease-out;
        }
        
        @keyframes slideIn {
            from {
                opacity: 0;
                transform: translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }
        
        .card-content {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 0;
        }
        
        .image-section {
            background: linear-gradient(135deg, #f093fb 0%, #f5576c 100%);
            display: flex;
            align-items: center;
            justify-content: center;
            min-height: 600px;
        }
        
        .image-section img {
            width: 100%;
            height: 100%;
            object-fit: cover;
        }
        
        .text-section {
            padding: 60px 50px;
            display: flex;
            flex-direction: column;
            justify-content: center;
            background: linear-gradient(180deg, #ffffff 0%, #f8f9ff 100%);
        }
        
        .title {
            font-size: 32px;
            font-weight: 900;
            color: #2d3748;
            margin-bottom: 30px;
            line-height: 1.4;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
        }
        
        .greeting {
            font-size: 16px;
            line-height: 1.8;
            color: #4a5568;
            margin-bottom: 20px;
        }
        
        .message {
            font-size: 15px;
            line-height: 1.9;
            color: #5a6c7d;
            margin: 20px 0;
            font-weight: 300;
        }
        
        .closing {
            font-size: 18px;
            font-weight: 700;
            color: #764ba2;
            margin-top: 30px;
            padding-top: 20px;
            border-top: 2px solid #e2e8f0;
        }
        
        .footer {
            font-size: 12px;
            color: #cbd5e0;
            margin-top: 30px;
            text-align: right;
        }
        
        @media (max-width: 768px) {
            .card-content {
                grid-template-columns: 1fr;
            }
            
            .image-section {
                min-height: 300px;
            }
            
            .text-section {
                padding: 40px 30px;
            }
            
            .title {
                font-size: 24px;
            }
            
            .greeting {
                font-size: 14px;
            }
            
            .message {
                font-size: 13px;
            }
        }
    </style>
</head>

                <div class="title">2026년,<br>에스엔디랩스의 새로운<br>도약을 함께 그려갑니다.</div>
                
                <div class="greeting">임직원 여러분, 안녕하십니까.</div>
                
                <div class="message">
                    지난 한 해 동안 에스엔디랩스가 거둔 모든 성과는 여러분의 열정과 헌신이 있었기에 가능했습니다. 묵묵히 자리를 지키며 최선을 다해주신 여러분께 깊은 감사의 인사를 전합니다.
                </div>
                
                <div class="message">
